import React from "react";
import "../../styles/ProyectosCard.css";


const ProyectosCard = ({ title, description, link }) => {
  return (
    <div className="proyecto-card">
      <h2>{title}</h2>
      <p>{description}</p>
      <a href={link} target="_blank" rel="noopener noreferrer">Ver proyecto</a>
    </div>
  );
};

export default ProyectosCard;
